import React from "react";
import axios from "axios";

export default function Test() {
  function axiosTest() {
    return axios
      .get(
        "http://localhost:8500/celerant360/server/coldfusion/taxonomy.cfc?method=getTaxonomy"
      )
      .then((response) => response.data);
  }

  const abc = async () => {
    try {
      return await axios.get(
        "http://localhost:8500/celerant360/server/coldfusion/taxonomy.cfc?method=getTaxonomy"
      );
    } catch (error) {
      console.error(error);
    }
  };
  const xyz = async () => {
    const breeds = await abc();
    return breeds.data;
  };
  let a = xyz();
  var value = "";
  a.then(function (val) {
    value = val;
    return value;
  });
  console.log("ppppp");

  console.log(value);

  console.log("pti");
  console.log(a);

  return (
    <button
      onClick={() => {
        xyz();
      }}
    >
      click me
    </button>
  );
}
